INSERT INTO `articles` VALUES (2, '使用Annotation配置', 7, 1, '<p>使用Spring的IoC容器，实际上就是通过类似XML这样的配置文件，把我们自己的Bean的依赖关系描述出来，然后让容器来创建并装配Bean。一旦容器初始化完毕，我们就直接从容器中获取Bean使用它们。</p><p>使用XML配置的优点是所有的Bean都能一目了然地列出来，并通过配置注入能直观地看到每个Bean的依赖。它的缺点是写起来非常繁琐，每增加一个组件，就必须把新的Bean配置到XML中。</p><p>有没有其他更简单的配置方式呢？</p><p>有！我们可以使用Annotation配置，可以完全不需要XML，让Spring自动扫描Bean并组装它们。</p><p>我们把上一节的示例改造一下，先删除XML配置文件，然后，给<code>UserService</code>和<code>MailService</code>添加几个注解。</p><p>首先，我们给<code>MailService</code>添加一个<code>@Component</code>注解：</p>', 1640753330584, 1640972056697);
INSERT INTO `articles` VALUES (3, 'Spring开发', 7, 1, '<h1 id=\"puwy3\"><p><font size=\"3\">Spring最早是由Rod Johnson这哥们在他的《<a href=\"https://book.douban.com/subject/1426848/\" target=\"_blank\">Expert One-on-One J2EE Development without EJB</a>》一书中提出的用来取代EJB的轻量级框架。随后这哥们又开始专心开发这个基础框架，并起名为Spring Framework。</font></p><p><font size=\"3\">随着Spring越来越受欢迎，在Spring Framework基础上，又诞生了Spring Boot、Spring Cloud、Spring Data、Spring Security等一系列基于Spring Framework的项目。本章我们只介绍Spring Framework，即最核心的Spring框架。后续章节我们还会涉及Spring Boot、Spring Cloud等其他框架。</font></p></h1>', 1640914366907, 1640972026555);
INSERT INTO `articles` VALUES (4, 'How to integrate Hibernate (ORM framework)', 7, 1, '<p>使用<code>JdbcTemplate</code>的时候，我们用得最多的方法就是<code>List&lt;T&gt; query(String sql, Object[] args, RowMapper rowMapper)</code>。这个<code>RowMapper</code>的作用就是把<code>ResultSet</code>的一行记录映射为Java Bean。</p><p>这种把关系数据库的表记录映射为Java对象的过程就是ORM：Object-Relational Mapping。ORM既可以把记录转换成Java对象，也可以把Java对象转换为行记录。</p><p>使用<code>JdbcTemplate</code>配合<code>RowMapper</code>可以看作是最原始的ORM。如果要实现更自动化的ORM，可以选择成熟的ORM框架，例如<a href=\"https://hibernate.org/\" target=\"_blank\">Hibernate</a>。</p><p>我们来看看如何在Spring中集成Hibernate。</p><p>Hibernate作为ORM框架，它可以替代<code>JdbcTemplate</code>，但Hibernate仍然需要JDBC驱动，所以，我们需要引入JDBC驱动、连接池，以及Hibernate本身。</p>', 1640914568539, 1640971971430);
